  let icons

  if (Array.isArray(titles)) {
    return icons = titles.map(title => {
      return setIcons.filter(icon => icon.title === title).map(
        icon => {
          return icon.svg
        }
      )
    })
  } else {
    icons = setIcons.find(icon => icon.title === titles)
    return icons.svg
  }

